import React, { useState, useEffect } from 'react';

function MatrixForm({ onSubmit }) {
    const [formData, setFormData] = useState({
        mode: 'compare',
        size: 500,
        threads: 4
    });

    const [availableThreads, setAvailableThreads] = useState(4);

    useEffect(() => {
        // API'den uygun thread sayısını almak için sağlık kontrolünü kullan
        fetch('/api/health')
            .then(response => response.json())
            .then(data => {
                // API'den gelen thread verisi varsa kullan
                if (data.availableThreads) {
                    setAvailableThreads(data.availableThreads);
                    setFormData(prev => ({
                        ...prev,
                        threads: Math.min(prev.threads, data.availableThreads)
                    }));
                }
            })
            .catch(error => console.error('API health check error:', error));
    }, []);

    const handleChange = (e) => {
        const { name, value } = e.target;

        if (name === 'size') {
            // Matris boyutu için sınırlamalar
            const size = parseInt(value);
            if (size < 500) return; // Çok küçük matrisler için hesaplama anlamlı değil
            if (size > 1500) return; // Çok büyük matrisler çok fazla bellek kullanabilir

            setFormData({
                ...formData,
                [name]: size
            });
        } else if (name === 'threads') {
            // Thread sayısı için sınırlamalar
            const threads = parseInt(value);
            if (threads < 1) return;
            if (threads > availableThreads) return;

            setFormData({
                ...formData,
                [name]: threads
            });
        } else {
            setFormData({
                ...formData,
                [name]: value
            });
        }
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        onSubmit(formData);
    };

    return (
        <form onSubmit={handleSubmit}>
            <div className="mb-2">
                <label htmlFor="mode" className="form-label mb-1 fw-bold small">Çalıştırma Modu</label>
                <select
                    id="mode"
                    name="mode"
                    className="form-select form-select-sm"
                    value={formData.mode}
                    onChange={handleChange}
                >
                    <option value="compare">Tüm Algoritmaları Karşılaştır</option>
                    <option value="sequential">Sadece Sequential</option>
                    <option value="parallel">Sadece Basic Parallel</option>
                    <option value="improved">Sadece Improved Parallel</option>
                    <option value="blocked">Sadece Block-Based Parallel</option>
                </select>
            </div>

            <div className="mb-2">
                <label htmlFor="size" className="form-label mb-1 fw-bold small">
                    Matris Boyutu: {formData.size}x{formData.size}
                </label>
                <input
                    type="range"
                    className="form-range"
                    id="size"
                    name="size"
                    min="500"
                    max="1500"
                    step="100"
                    value={formData.size}
                    onChange={handleChange}
                />
                <div className="d-flex justify-content-between small">
                    <small>500</small>
                    <small>1000</small>
                    <small>1500</small>
                </div>
            </div>

            <div className="mb-2">
                <label htmlFor="threads" className="form-label mb-1 fw-bold small">
                    Thread Sayısı: {formData.threads}
                </label>
                <input
                    type="range"
                    className="form-range"
                    id="threads"
                    name="threads"
                    min="1"
                    max={availableThreads}
                    value={formData.threads}
                    onChange={handleChange}
                    disabled={formData.mode === 'sequential'}
                />
                <div className="d-flex justify-content-between small">
                    <small>1</small>
                    <small>{Math.floor(availableThreads / 2)}</small>
                    <small>{availableThreads}</small>
                </div>
            </div>

            <div className="alert alert-info py-2 small mb-2">
                <strong>Bilgi:</strong> Büyük matris boyutları (1000+) hesaplama süresini belirgin şekilde artırabilir.
            </div>

            <button type="submit" className="btn btn-primary btn-sm w-100">
                Hesapla ve Karşılaştır
            </button>
        </form>
    );
}

export default MatrixForm;
